$(function() {

$('#my-menu').mmenu({
	extensions: ['border-full', 'pagedim-black', 'position-right'],
	navbar: {
		title: '<img src="img/Logo.svg">'
	}
});

var api = $('#my-menu').data('mmenu');
api.bind('open:finish', function () {
	$('.hamburger').addClass('is-active');
}).bind('close:finish', function () {
	$('.hamburger').removeClass('is-active');
});	

$('.slider-nav').slick({
	slidesToShow: 3,
	slidesToScroll: 1,
	arrows: false,
	focusOnSelect: true,
	asNavFor: '.slider-for',
	responsive: [
		{
      breakpoint: 768,
      settings: {
        slidesToShow: 1
      }
    }
  ]
});
$('.slider-for').slick({
  slidesToShow: 1,
	slidesToScroll: 1,
	speed: 400,
	dots: true,
	asNavFor: '.slider-nav',
	responsive: [
		{
      breakpoint: 768,
      settings: {
        arrows: false
      }
    }
  ]
});

$('body').on('click', '[href*="#"]', function(e) {
	var fixed_offset = 0;
$('html,body').stop().animate({ scrollTop: $(this.hash).offset().top - fixed_offset }, 1000);
e.preventDefault();
});

ScrollReveal({ reset: false });
ScrollReveal().reveal('.services', { delay: 100, duration: 1000 });
ScrollReveal().reveal('.portfolio', { delay: 100, duration: 1000 });
ScrollReveal().reveal('.brands', { delay: 100, duration: 1000 });
ScrollReveal().reveal('.reviews', { delay: 100, duration: 1000 });
ScrollReveal().reveal('.contacts', { delay: 100, duration: 1000 });

});
